import React, { useEffect } from "react";
import scrapeIt from "scrape-it";

const News = () => {
  useEffect(() => {
    scrapeIt("https://ionicabizau.net", {
      title: ".header h1",
      desc: ".header h2",
      avatar: {
        selector: ".header img",
        attr: "src",
      },
      pages: {
        listItem: "li.page",
        name: "pages",
        data: {
          title: "a",
          url: {
            selector: "a",
            attr: "href",
          },
        },
      },
    }).then(({ data, response }) => {
      console.log(`Status Code: ${response.statusCode}`);
      console.log(data);
    });
  }, []);

  return <div></div>;
};

export default News;
